import React from "react";
import profile from "../../images/profile.svg";

const Comment = ({ comment }) => {
  return (
    <div className="p-4">
      <div className="flex">
        <div>
          <img className="w-6 h-6" src={profile} alt="" />
          <h3 className="text-sm pl-3 font-bold">{`유저 ${comment.id}`}</h3>
        </div>
      </div>
    </div>
  );
};

export default Comment;
